import { Button, List } from 'antd';
import React, { FC } from 'react';

export interface ListProps {
  nickname: string;
}

interface ConnectionListProps {
  title: string;
  data: ListProps[];
}

export const ConnectionList: FC<ConnectionListProps> = ({ title, data }) => {
  return (
    <List
      header={title}
      style={{
        marginBottom: 20,
      }}
      grid={{
        gutter: 4,
        xs: 2,
        md: 3,
      }}
      size='small'
      loadMore={
        <div
          style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            margin: '12px',
          }}>
          <Button>More...</Button>
        </div>
      }
      bordered
      dataSource={data}
    />
  );
};

export default null;
